import React from 'react';
import logo from './logo.svg';
import './App.css';

function Countdown(props){
  return <>
  <label>Contador</label>
  <input type="text" value={props.countdown}></input>
  <button value="START"></button>
  </>;
}

function App() {
  return (
    <Countdown countdown="4"/>
  );
}

export default App;
